import React from "react";
import { RuxGlobalStatusBar } from "@astrouxds/rux-global-status-bar/rux-global-status-bar.js";

function NavBar(props) {
	return (
		<header className="header">
			<rux-global-status-bar>
				<rux-button>HI</rux-button>
			</rux-global-status-bar>
		</header>
	);
}
